import React, { Component } from "react";
import Cards from "./Cards";
import "./CardList.css";

class CardList extends Component {
  render() {
    return (
      <div className="main">
        <div className="card-box">
          <Cards />
        </div>
        <div className="my-card">
          <Cards />
        </div>
        <div className="my-card">
          <Cards />
        </div>
      </div>
    );
  }
}
export default CardList;
